#define VALUE_FAIL Value::FLAG_1



// --------------------------------------------------------------------------
// Arithmetic helper function to take care of slow path of interpretation
// --------------------------------------------------------------------------
Value InterpreterDoArithmetic( Runtime* sandbox ,
                               Value left ,  // rsi
                               Value right , // rdx
                               Bytecode bc ) {
  (void)sandbox;
  (void)left;
  (void)right;
  (void)bc;
  {
    Value r;
    SetValueFlag( &r, VALUE_FAIL );
    return r;
  }
}
